import axios from "axios";

const url = "https://api.github.com/users/EhsanShakil/";

const Fetch = async () => {
  try {
    const [data] = await axios.get(url);
    console.log("ahsan");
  } catch (error) {
    console.log(error);
  }
};

export default Fetch;
